import React from 'react';
import image1 from './pictures/1.png';

function AboutUs() {
  return (
    <div className="grid grid-cols-2 gap-4">
      <div className="flex flex-col items-center justify-center overflow-y-auto h-64">
        <img src={image1} alt="Image 1" className="w-full object-cover rounded-lg" />
        <p className="text-lg mt-4">Image 1 Text</p>
      </div>
      <div className="flex flex-col items-center justify-center overflow-y-auto h-64">
        <p className="text-lg mb-4">Image 2 Text</p>
        <img src="your-image.jpg" alt="Image 2" className="w-full object-cover rounded-lg" />
      </div>
    </div>
  );
}


export default AboutUs;
